import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';


ReactDOM.render(
    <Router>
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to={"/"}>Главная</Link>
                    </li>
                    <li>
                        <Link to={"/"}></Link>
                    </li>
                </ul>
            </nav>
        </div>
    </Router>,
    document.getElementById('root')
);
